//import React from 'react'; // TODO: remove in prod
//import ReactDOM from 'react-dom'; // TODO: remove in prod
import { createStore } from 'redux';
import { Provider } from 'react-redux';
import App from './src/app';
import Loading from './src/loading';
import schedApp from './src/reducers';
import { parseURLOrHistory } from './src/history';
import { editMap, addCourse, toggleSection } from './src/actions';

/**
 * Store format:
 * {
 *   courses: [
 *     {
 *       dept: <String>,
 *       level: <String>
 *       sections: [ { number: <String>, color: <String> }]
 *     }
 *   ],
 *   data: {
 *     semester: {
 *       dept: {
 *         level: {
 *           section: {}
 *         }
 *       }
 *     }
 *   },
 *   semester: <String>,
 *   map: { building: { lng: <Number>, lat: <Number> } }
 * }
 */

ReactDOM.render(
  <Loading />,
  document.getElementById('app')
);

if (window.Worker) {
  var dataFetchWorker = new Worker('data_fetch_worker.js');
  dataFetchWorker.onmessage = e => {
    initializeApp(e.data);
  }
  window.mapWorker = new Worker('map_worker.js')
}

const initializeApp = data => {
  const history = parseURLOrHistory();
  let { semester, schedule } = history;

  if (!semester || Object.keys(data).indexOf(semester) === -1) {
    semester = Object.keys(data)[0];
    schedule = [];
  }

  const store = createStore(schedApp, Immutable.Map({
    courses: Immutable.List(),
    data: Immutable.fromJS(data),
    map: Immutable.Map({}),
    colors: Immutable.Map({
      '#adff8c': 0,
      '#ffc379': 0,
      '#71c1fd': 0,
      '#f7ff78': 0,
      '#fd7f7f': 0,
    }),
    semester
  }));

  ReactDOM.render(
    <Provider store={store}>
      <App />
    </Provider>,
    document.getElementById('app')
  );

  for (let i = 0; i < schedule.length; i++) {
    let course = schedule[i];
    store.dispatch(addCourse(course[0], course[1]));
    for (let j = 0; j < course[2].length; j++) {
      store.dispatch(toggleSection(course[0], course[1], course[2][j]));
    }
  }

  if (window.Worker) {
    window.mapWorker.onmessage = e => {
      store.dispatch(editMap(e.data));
    };
  }
};

/**
 * Reducers
 */
import {
  EDIT_MAP,
  ADD_COURSE,
  REMOVE_COURSE,
  TOGGLE_SECTION,
  SELECT_SEMESTER
} from './actions';
import {
  loadCoursesFromHistory,
  saveSemesterToHistory
} from './history';

function schedApp(state, action) {
  switch (action.type) {

    case ADD_COURSE:
      if (state.get('courses')
        .find(course =>
          course.get('dept') === action.dept && course.get('level') === action.level)) {
        return state;
      }

      state = state.updateIn(['courses'], Immutable.List(), list => list
        .push(Immutable.Map({
          dept: action.dept,
          level: action.level,
          sections: Immutable.List()
        }))
      );

      save(state);

      return state;


    case REMOVE_COURSE:
      state = state.updateIn(['courses'], Immutable.List(), list => list
        .filterNot(course =>
          course.get('dept') === action.dept && course.get('level') === action.level)
      );

      save(state);

      return state.set('selectedCourse', Immutable.Map());


    case TOGGLE_SECTION: {
      const courseIdx = state.get('courses')
        .findIndex(c => c.get('dept') === action.dept && c.get('level') === action.level);

      let course = state.getIn(['courses', courseIdx]);

      if (course.get('sections').find(section => section.get('number') === action.section)) {
        // if its already in there, remove it
        course = course.update('sections', Immutable.List(), list => list
          .filterNot(section => {
            // decrease color count
            if (section.get('number') === action.section) {
              state = state.updateIn(['colors', section.get('color')], 0, c => --c);
              return true;
            }
            return false;
          })
        );
      } else {
        // else, add it

        // choose color
        const color = getColor(state.get('colors'));
        state = state.updateIn(['colors', color], 1, c => ++c);

        course = course
          .update(
            'sections',
            Immutable.List(),
            list => list.push(Immutable.Map({ number: action.section, color }))
          );

        if (!state.getIn([
          'data',
          state.get('semester'),
          course.get('dept'),
          course.get('level'),
          action.section
        ]).has('building')) {
          // if we haven't geocoded this section before,
          // geocode it in the map worker
          // this is bad separation of concerns for the reducer
          const crn = state.getIn([
            'data',
            state.get('semester'),
            course.get('dept'),
            course.get('level'),
            action.section,
            'CRN'
          ]);

          window.mapWorker.postMessage({
            semester: state.get('semester'),
            dept: course.get('dept'),
            level: course.get('level'),
            section: action.section,
            crn
          });
        }
      }


      state = state.setIn(['courses', courseIdx], course);

      save(state);

      return state;
    }


    case SELECT_SEMESTER:
      // FIXME: bad side effect
      // the reducer should just be applying actions to state
      save(state);

      state = state.set('colors', Immutable.Map({
        '#fd7f7f': 0,
        '#adff8c': 0,
        '#ffc379': 0,
        '#71c1fd': 0,
        '#f7ff78': 0
      }));

      return state
        .set('semester', action.semester)
        .set('courses', Immutable.List());


    case EDIT_MAP:
      let d = action.data;

      // set building property of section
      state = state.setIn(
        ['data', state.get('semester'), d.dept, d.level, d.section, 'building'],
        d.building
      );

      // set coordinates of building in map data
      if (!state.get('map').has(d.building)) {
        state = state.setIn(['map', d.building], Immutable.Map(d.coords));
      }

      return state


    default:
      return state;

  }
}

export default schedApp;

/**
 * colors: <Immutable.Map>
 * {
 *    <hex color: string>: <uses: int>
 * }
 */
const getColor = colors => colors.entrySeq().min((a, b) => {
  if (a[1] < b[1]) return -1;
  if (a[1] > b[1]) return 1;
  return 0;
})[0];

/**
 * save a semester to localStorage
 */
function save(state) {
  saveSemesterToHistory(
    state.get('semester'),
    state.get('courses')
      .map(c => [
        c.get('dept'),
        c.get('level'),
        c.get('sections').map(s => s.get('number')).toArray()
      ]).toArray()
  );
}

/**
 * This file defines methods that handle persisting data
 * and url encoded schedules
 */
import URLSearchParams from 'url-search-params';


/**
 * Parse the url or localStorage for a schedule
 */
export function parseURLOrHistory() {
  let semester, schedule;
  const params = new URLSearchParams(location.search.slice(1));
  if (params.has('s')) {
    semester = params.get('s');
    if (params.has('q')) {
      try {
        schedule = JSON.parse(decodeURIComponent(params.get('q')));
      } catch (e) {
        console.log('Incorrect url format');
        console.log(params.get('q'));
        console.log(e);
        schedule = [];
      }
    }
  } else if (localStorage.schedHistory) {
    try {
      const schedHistory = JSON.parse(localStorage.schedHistory);
      semester = schedHistory.semester;
      schedule = schedHistory.schedules[semester];
    } catch (e) {
      console.log('Could not parse history from localstorage');
      console.log(e);
      console.log('Deleting localStorage');
      delete localStorage.schedHistory;
      semester = null;
      schedule = [];
    }
  } else {
    semester = null;
    schedule = [];
  }
  return { semester, schedule };
}


/**
 * Given a semester, return its course history
 * from localStorage if available
 */
export function loadCoursesFromHistory(semester) {
  let schedHistory;
  if (localStorage.schedHistory) {
    try {
      schedHistory = JSON.parse(localStorage.schedHistory);
    } catch (e) {
      console.log('Could not load history');
      console.log(localStorage.schedHistory);
      console.log(e);
      console.log('Deleting localStorage');
      delete localStorage.schedHistory;
      return [];
    }
  }
  if (semester in schedHistory.schedules)
    return schedHistory.schedules[semester];

  return [];
}

export function saveSemesterToHistory(semester, courses) {
  let history;
  const historyStr = localStorage.schedHistory;
  if (historyStr) {
    try {
      history = JSON.parse(historyStr);
    } catch (e) {
      console.log('Unable to parse localStore history');
      console.log(historyStr);
      console.log(e);
      history = {};
    }
  } else {
    history = { schedules: {} };
  }

  localStorage.setItem('schedHistory', JSON.stringify({
    semester,
    schedules: Object.assign(history.schedules, { [semester]: courses })
  }));
}

/**
 * Loading view
 */

class Loading extends React.Component {

  constructor(props) {
    super(props);
    this.state = { reload: false };
  }

  componentDidMount() {
    this.reloadTimeout = setTimeout(() => {
      this.setState({ reload: true });
    }, 7000);
  }

  componentWillUnmount() {
    clearTimeout(this.reloadTimeout);
  }

  render() {
    return (<div style={{paddingTop: '6em'}}>
      <div className='center'>
        <svg xmlns='http://www.w3.org/2000/svg' viewBox='0 0 32 32' width='64' height='64' fill='black'>
          <circle cx='16' cy='3' r='0'>
          <animate attributeName='r' values='0;3;0;0' dur='1s' repeatCount='indefinite' begin='0' keySplines='0.2 0.2 0.4 0.8;0.2 0.2 0.4 0.8;0.2 0.2 0.4 0.8' calcMode='spline' />
          </circle>
          <circle transform='rotate(45 16 16)' cx='16' cy='3' r='0'>
          <animate attributeName='r' values='0;3;0;0' dur='1s' repeatCount='indefinite' begin='0.125s' keySplines='0.2 0.2 0.4 0.8;0.2 0.2 0.4 0.8;0.2 0.2 0.4 0.8' calcMode='spline' />
          </circle>
          <circle transform='rotate(90 16 16)' cx='16' cy='3' r='0'>
          <animate attributeName='r' values='0;3;0;0' dur='1s' repeatCount='indefinite' begin='0.25s' keySplines='0.2 0.2 0.4 0.8;0.2 0.2 0.4 0.8;0.2 0.2 0.4 0.8' calcMode='spline' />
          </circle>
          <circle transform='rotate(135 16 16)' cx='16' cy='3' r='0'>
          <animate attributeName='r' values='0;3;0;0' dur='1s' repeatCount='indefinite' begin='0.375s' keySplines='0.2 0.2 0.4 0.8;0.2 0.2 0.4 0.8;0.2 0.2 0.4 0.8' calcMode='spline' />
          </circle>
          <circle transform='rotate(180 16 16)' cx='16' cy='3' r='0'>
          <animate attributeName='r' values='0;3;0;0' dur='1s' repeatCount='indefinite' begin='0.5s' keySplines='0.2 0.2 0.4 0.8;0.2 0.2 0.4 0.8;0.2 0.2 0.4 0.8' calcMode='spline' />
          </circle>
          <circle transform='rotate(225 16 16)' cx='16' cy='3' r='0'>
          <animate attributeName='r' values='0;3;0;0' dur='1s' repeatCount='indefinite' begin='0.625s' keySplines='0.2 0.2 0.4 0.8;0.2 0.2 0.4 0.8;0.2 0.2 0.4 0.8' calcMode='spline' />
          </circle>
          <circle transform='rotate(270 16 16)' cx='16' cy='3' r='0'>
          <animate attributeName='r' values='0;3;0;0' dur='1s' repeatCount='indefinite' begin='0.75s' keySplines='0.2 0.2 0.4 0.8;0.2 0.2 0.4 0.8;0.2 0.2 0.4 0.8' calcMode='spline' />
          </circle>
          <circle transform='rotate(315 16 16)' cx='16' cy='3' r='0'>
          <animate attributeName='r' values='0;3;0;0' dur='1s' repeatCount='indefinite' begin='0.875s' keySplines='0.2 0.2 0.4 0.8;0.2 0.2 0.4 0.8;0.2 0.2 0.4 0.8' calcMode='spline' />
          </circle>
          <circle transform='rotate(180 16 16)' cx='16' cy='3' r='0'>
          <animate attributeName='r' values='0;3;0;0' dur='1s' repeatCount='indefinite' begin='0.5s' keySplines='0.2 0.2 0.4 0.8;0.2 0.2 0.4 0.8;0.2 0.2 0.4 0.8' calcMode='spline' />
          </circle>
        </svg>
      </div>
      <div className='center'>
        chill out for a sec...
      </div>
      {this.state.reload && <div className='center'>
        hmm...this seems to be taking a while...try refreshing
      </div>}
    </div>);
  }

}

export default Loading;

export const ADD_COURSE = 'ADD_COURSE';
export const REMOVE_COURSE = 'REMOVE_COURSE';
export const ADD_SECTION = 'ADD_SECTION';
export const TOGGLE_SECTION = 'TOGGLE_SECTION';
export const SELECT_SEMESTER = 'SELECT_SEMESTER';
export const EDIT_MAP = 'EDIT_MAP';

export function addCourse(dept, level) {
  return { type: ADD_COURSE, dept, level };
}

export function removeCourse(dept, level) {
  return { type: REMOVE_COURSE, dept, level };
}

export const addSection = (dept, level, section) =>
  ({ type: ADD_SECTION, dept, level, section });

export function toggleSection(dept, level, section) {
  return { type: TOGGLE_SECTION, dept, level, section };
}

export function selectSemester(semester) {
  return { type: SELECT_SEMESTER, semester };
}

export function editMap(data) {
  return { type: EDIT_MAP, data };
}

