function props2geoj(p) {
  const buildings = {};

  for (let i = 0; i < p.courses.size; i++) {
    let c = p.courses.get(i);

    for (let j = 0; j < c.get('sections').size; j++) {
      let building = p.data.getIn([
        p.semester,
        c.get('dept'),
        c.get('level'),
        c.getIn(['sections', j, 'number']),
        'building'
      ]);

