          sections: [],
          coords: p.buildings.getIn([building, 'coords']),
          color: c.getIn(['sections', j, 'color'])
        };
      }

      buildings[building].sections.push({
        dept: c.get('dept'),
        level: c.get('level'),
        section: c.getIn(['sections', j, 'number'])
      });
    }
  }

